import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {App} from './App';
import reportWebVitals from './reportWebVitals';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from "react-router-dom";
import {PostList} from "./components/Post";
import Home from "./components/home";
import NewPost from "./components/newPost";
import AboutMe from "./components/aboutMe";
import ContactMe from "./components/contactMe";
import InputWithIcon from './components/login';
import PersistentDrawerLeft from "./components/navBar";
import get_all_posts from './components/login'
let postData = get_all_posts()
let app = (
    <Router>
        <div>
            <div className="title">
                <section className="table">
                    <App page="/" name="left_title" id="home" path="#Home" content="Home" func = {get_all_posts()}/>
                    <App page="/about_me" name="left_title" id="aboutme" content="About Me"/>
                    <App page="/new_post" name="left_title" id="nan1" content="New Post"/>
                    <App page="/Post" name="left_title" id="nan2" content="Post"/>
                    <App page="/contact_me" name="left_title" content="Contact Me"/>
                    <App page="/login" name="right_title" id="login" content="Login"/>
                </section>
            </div>
            <Switch>
                <Route path="/login">
                    <InputWithIcon />
                </Route>
                <Route path="/contact_me">
                    <ContactMe />
                </Route>
                <Route path="/Post">
                        <PostList posts = {postData} />
                </Route>
                <Route path="/new_post">
                    <NewPost />
                </Route>
                <Route path="/about_me">
                    <AboutMe />
                </Route>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>
        </div>
    </Router>
);


ReactDOM.render(
    app,
    document.getElementById('root1')
);


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
